import './App.css';
import Navbar from 'component/navbar';
import { Redirect, Route } from 'react-router-dom'
import Home from 'pages/home'
import About from 'pages/about'
import Gba from 'pages/GBA'
import React from 'react';
import Pg from 'pages/GBA/pg'
import Nm from 'pages/GBA/nm'
import Ph from 'pages/GBA/ph'
function App() {
  return (
    <div className="App">
      <Navbar />
      <Route path='/home' component={Home}></Route>
      <Route path='/about' component={About}></Route>
      <Route path='/gba' component={Gba}></Route>
      <Route path='/gba/pg' component={Pg}></Route>
      <Route path='/gba/nm' component={Nm}></Route>
      <Route path='/gba/ph' component={Ph}></Route>
      <Route path='/handbook' component={Gba}></Route>
      <Redirect to='/home' />
    </div>
  );
}

export default App;
